import React from 'react';
import Navbar from '../../component/Navbar/Navbar'
import Footer from '../../component/Footer/Footer'
import {Input, Space, Layout, Button} from 'antd';
import { AudioOutlined } from '@ant-design/icons';

const { Content } = Layout;
const contentStyle = {
    height:'100%',
    width:'100%', 
    backgroundColor:'#0D0311', 
    display:'flex',
    justifyContent:'center',
    flexDirection:'column',
    paddingTop:'35vh',
    alignItems:'center'
}

const divStyle1 = {
    // border:'2px solid green',
    width:'90vw',
    height:'70vh',
    color:'red',
    textAlign:'center'
}

const divStyle2 = {
    border:'2px solid lightgreen',
    width:'90vw',
    height:'300vh',
    color:'red'
}


const scrollToTop = () =>{
window.scrollTo({
    top: 0, 
    behavior: 'smooth'
    /* you can also use 'auto' behaviour
        in place of 'smooth' */
});
}

const { Search } = Input;

const onSearch = value => console.log(value);

class find extends React.Component{
    render() {
        return(
            <Layout>
                <Navbar/>
                <Content style={contentStyle}>
                    <div style={divStyle1}>
                        <Space direction="vertical" style={{textAlign:'center'}}>
                                <Search
                                placeholder="ENTER NAME/HASHTAG TO FIND YOUR STANDEE"
                                allowClear
                                size="large"
                                onSearch={onSearch}
                                allowClear
                                style={{ width: '50vw',fontFamily:'Montserrat', fontWeight:'Bold'}}
                                onClick={scrollToTop}
                                />
                            <div style={{fontFamily:'Montserrat', fontWeight:'Bold', color:'#F5F1E3', fontSize:'1rem'}}>or</div>
                            <Button type="primary" shape='round' style={{height:'3rem', fontFamily:'Montserrat', fontWeight:'Bold', color:'#5C082A', backgroundColor:'#F5F1E3',width:'20vw'}}>TELL SOMEONE AROUND THERE</Button>
                            </Space>
                    </div>
                    <div style={divStyle2}>
                            RESULT
                    </div>
                </Content>
                <Footer/>
            </Layout>
        )
    }
}

export default find
